"use strict";(self.webpackChunkblog=self.webpackChunkblog||[]).push([[9289],{5241:(a,e,n)=>{n.r(e),n.d(e,{data:()=>s});const s={key:"v-cff376e8",path:"/shell/tar.html",title:"",lang:"zh-CN",frontmatter:{},excerpt:"",headers:[{level:3,title:"tar 命令使用总结",slug:"tar-命令使用总结",children:[]}],filePathRelative:"shell/tar.md",git:{updatedTime:1633945792e3,contributors:[{name:"peak",email:"peak@jiemogame.com",commits:2}]}}},7163:(a,e,n)=>{n.r(e),n.d(e,{default:()=>t});const s=(0,n(6252).uE)('<h3 id="tar-命令使用总结" tabindex="-1"><a class="header-anchor" href="#tar-命令使用总结" aria-hidden="true">#</a> <code>tar</code> 命令使用总结</h3><p align="right">Update: 2019-5-14</p><blockquote><p>manipulate tape archives.</p><p><strong>tar</strong> creates and manipulates streaming archive files.</p><p>This implementation can extract from tar, pax, cpio, zip, jar, ar, and ISO 9660 cdrom images</p><p>and can create tar, pax, cpio, ar, and shar archives.</p></blockquote><p>用来压缩和解压文件。<code>tar</code> 本身不具有压缩功能, 它是调用压缩功能实现的。</p><h4 id="常用参数" tabindex="-1"><a class="header-anchor" href="#常用参数" aria-hidden="true">#</a> 常用参数</h4><p>模式说明符( <code>tar</code> 命令后的第一个参数必须是下面中的某一个)</p><blockquote><p><mark>-c</mark> 压缩文件</p><p><mark>-x</mark> 解压文件</p><p><mark>-t</mark> 查看文件压缩内容</p><p><mark>-r</mark> 向压缩归档文件末尾追加文件</p></blockquote><p>可选参数</p><blockquote><p><mark>-v</mark> 显示操作过程所有信息</p><p><mark>-C</mark> 切换到指定目录</p><p><mark>-f</mark> 指定压缩文件</p></blockquote><h4 id="常见用法" tabindex="-1"><a class="header-anchor" href="#常见用法" aria-hidden="true">#</a> 常见用法</h4><p>新建 <code>a.txt</code> 和 <code>b.txt</code> 文件。</p><ol><li>把 <code>a.txt</code> 和 <code>b.txt</code> 文件打包成 <code>new.tar</code> 文件.</li></ol><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code><span class="token function">tar</span> -cf new.tar a.txt b.txt\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><ol start="2"><li>列举出 <code>new.tar</code> 文件压缩内容</li></ol><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code>chenxi$ <span class="token function">tar</span> -tvf new.tar \n-rw-r--r--  <span class="token number">0</span> chenxi staff       <span class="token number">5</span>  <span class="token number">5</span> <span class="token number">14</span> <span class="token number">22</span>:46 a.txt\n-rw-r--r--  <span class="token number">0</span> chenxi staff       <span class="token number">6</span>  <span class="token number">5</span> <span class="token number">14</span> <span class="token number">22</span>:46 b.txt\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br></div></div><ol start="3"><li>解压 <code>new.tar</code> 到 <code>dir</code> 目录下</li></ol><p>新建 <code>dir</code> 目录, 执行命令</p><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code>chenxi$ <span class="token function">tar</span> -xvf new.tar -C <span class="token function">dir</span>\nx a.txt\nx b.txt\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br></div></div>',18),r={},t=(0,n(3744).Z)(r,[["render",function(a,e){return s}]])},3744:(a,e)=>{e.Z=(a,e)=>{for(const[n,s]of e)a[n]=s;return a}}}]);